export const consolePrefix="SweetAlert2:";export const capitalizeFirstLetter=str=>str.charAt(0).toUpperCase()+str.slice(1);export const warn=message=>{console.warn(`${consolePrefix} ${typeof message==="object"?message.join(" "):message}`)};export const error=message=>{console.error(`${consolePrefix} ${message}`)};const previousWarnOnceMessages=[];export const warnOnce=message=>{if(!previousWarnOnceMessages.includes(message)){previousWarnOnceMessages.push(message);warn(message)}};export const warnAboutDeprecation=(deprecatedParam,useInstead=null)=>{warnOnce(`"${deprecatedParam}" is deprecated and will be removed in the next major release.${useInstead?` Use "${useInstead}" instead.`:""}`)};export const callIfFunction=arg=>typeof arg==="function"?arg():arg;export const hasToPromiseFn=arg=>arg&&typeof arg.toPromise==="function";export const asPromise=arg=>hasToPromiseFn(arg)?arg.toPromise():Promise.resolve(arg);export const isPromise=arg=>arg&&Promise.resolve(arg)===arg;